package com.holger.leetcode.P03无重复最长子串;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

/**
 * @author Holger
 * @date 2018/11/21
 */
class Solution {
    public int lengthOfLongestSubstring(String s) {
        int max = 0;
        int start = 0;
        String temp = "";
	for(int i = 0; i < s.length(); i ++){
	    if(temp.isEmpty()){
	        start = i;
	    }
	    if(temp.indexOf(s.charAt(i)) == -1){
		temp += s.charAt(i);
	        if(temp.length() > max){
	            max = temp.length();
		}
	    }else {
	        i = start;
	        temp = "";
	    }
	}
	return max;
    }
    class Solution2 {
	public int lengthOfLongestSubstring(String s) {
	    int max = 0;
	    String temp = "";
	    for(int i = 0; i < s.length() && s.length() - i > max ; i ++){
		temp = "";
		temp += s.charAt(i);
		if(temp.length() > max){
		    max = temp.length();
		}
		temp = s.substring(i,i + max);
		for (int j = i + max; j < s.length();j++){
		    if(temp.indexOf(s.charAt(j)) == -1){
			temp += s.charAt(j);
			if(temp.length() > max){
			    max = temp.length();
			}
		    }else{
			break;
		    }
		}
	    }
	    return max;
	}
    }
}
class Solution3 {
    public int lengthOfLongestSubstring(String s) {
	int n = s.length(), ans = 0;
	// current index of character
	Map<Character, Integer> map = new HashMap<>(); 
	// try to extend the range [i, j]
	for (int j = 0, i = 0; j < n; j++) {
	    if (map.containsKey(s.charAt(j))) {
		i = Math.max(map.get(s.charAt(j)), i);
	    }
	    ans = Math.max(ans, j - i + 1);
	    map.put(s.charAt(j), j + 1);
	}
	return ans;
    }
}


class Solution4 {
    public int lengthOfLongestSubstring(String s) {
	int n = s.length();
	Set<Character> set = new HashSet<>();
	int ans = 0, i = 0, j = 0;
	while (i < n && j < n) {
	    // try to extend the range [i, j]
	    if (!set.contains(s.charAt(j))){
		set.add(s.charAt(j++));
		ans = Math.max(ans, j - i);
	    }
	    else {
		set.remove(s.charAt(i++));
	    }
	}
	return ans;
    }
}

class Solution5 {
	public int lengthOfLongestSubstring(String s) {
		String max= "";
		String tmp ="";
		for (int i = 0; i < s.length(); i++) {
			if(tmp.indexOf(s.charAt(i))== -1){
				tmp+=s.charAt(i);
			}else{
				tmp = "";
				tmp +=s.charAt(i);
			}
			
			if(tmp.length() > max.length()){
				max =tmp;
			}
		}
		return max.length();
	}
}

